"use strict";
var Monkey = /** @class */ (function () {
    function Monkey() {
    }
    Object.defineProperty(Monkey.prototype, "name", {
        get: function () {
            return this._name;
        },
        set: function (value) {
            this._name = value;
        },
        enumerable: false,
        configurable: true
    });
    Object.defineProperty(Monkey.prototype, "type", {
        get: function () {
            return 'monkey';
        },
        enumerable: false,
        configurable: true
    });
    Monkey.prototype.makeSound = function () {
        return "banana";
    };
    return Monkey;
}());
var Dog = /** @class */ (function () {
